import {Fragment} from 'react';
import styleClass from '../../CSS/UI/Card.module.css';
const Card =(props)=>{
    mixClasses=styleClass.Card+' '+props.className;
    return(
      
        <Fragment className={mixClasses}>
            {props.children}
        </Fragment>
    );
}

export default Card;
